import React from 'react';
import '../App.css';
import { Container,Button,Row,Col } from "react-bootstrap";
// import {Button} from '@material-ui/core'
import logo from '../assets/image/logo.png';

export default function Welcome(){
    return(
<div  className="main" >
    <Container fuild="xl" >
      <Row>
          <Col xl={12}>
    <img src={logo} style={{height:200,width:200,paddingLeft:400}}/>
    </Col>
    <Col xl={12}>
    <h1 style={{fontSize:50,color:"#fff",fontFamily:'Sonsie One'}}>WELCOME TO</h1>
    </Col>
    <Col xl={12}>
    <h4 style={{fontSize:40,color:"#fff",paddingLeft:510,fontFamily:'Carter One'}}>DIGITAL IMMUNITY</h4>
    </Col>
    <Col>
    <h6 style={{fontSize:30,color:"#fff",paddingLeft:600,fontFamily:'Carter One',letterSpacing:3}}>PASSPORT</h6>
    </Col>
    <Col>
    <Button variant="outline-primary">Get Started</Button>
    </Col>
    </Row>
    </Container>
    
</div>

    )
}
